import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Image } from 'react-bootstrap';
import NavigationBar from '../../components/NavigationBar'

import ImageQuiz1 from '../../assets/images/quiz1.png'
import ImageQuiz2 from '../../assets/images/quiz2.png'
import ImageQuiz3 from '../../assets/images/quiz3.png'
import ImageQuiz4 from '../../assets/images/quiz4.png'

import './styles.css';

function Quiz() {
  const [items, setItems] = useState([]);

  useEffect(() => {
    setItems([
      {name:'Quem ',img: ImageQuiz1},
      {name:'Quem ',img: ImageQuiz2},
      {name:'Quem ',img: ImageQuiz3},
      {name:'Quem ',img: ImageQuiz4},]);
  },[]);

  return ( 
    <>
    <NavigationBar/>
    <Container > 
      {items.map((item) =>(
        <Row>
          <Col xs={12} md={12}>
            <div className='container-quiz'>
              <div className='container-image'>
                <Image src={item.img} fluid/>
              </div>
              <div className='text-quiz'>

              </div>
            </div>
          </Col>
        </Row>
        ))}       
    </Container>   

    </>
  );
}

export default Quiz;
